        mHdltvoutHandle << " , " <<  " \"centroids_x_d0\" :  \"" << centroids_x_d0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"centroids_x_q0\" :  \"" << centroids_x_q0.read() << "\" ";
