        mHdltvoutHandle << " , " <<  " \"centroids_x_d1\" :  \"" << centroids_x_d1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"centroids_x_q1\" :  \"" << centroids_x_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"centroids_y_address0\" :  \"" << centroids_y_address0.read() << "\" ";
